      <p className="text-center mt-1">
        <Link to="/about">About</Link>|<Link to="/contact">Contact</Link>|    {/* applies css as a=>  .footer a {}   .footer a:hover{} */}
        <Link to="/policy">Privacy Policy</Link>
      </p>
    </div>
  );
};

